import React, { useEffect, useState } from "react";
import users from "../../images/users";
import { FaEdit } from "react-icons/fa";
import Chart from "../charts/chart";
import emojis from "../../images/emojis";
const Dashboard = () => {
  const [start, setStart] = useState(0);
  const [move, setMove] = useState(0);
  const [letMove, setLetMove] = useState(false);
  function onDrag(e) {
    // let pos = e.currentTarget.parentNode.getBoundingClientRect();
    // console.log("width parent", pos.right - pos.left);
  }

  function onDragEnd(e) {}
  return (
    <div
      className="container-fluid"
      style={{ height: "100%", maxWidth: "1300px" }}
    >
      <div className="row no-gutters justify-content-between">
        <div
          className="p-2 col-lg-4 col-md-8 col-sm-8 col-12"
          style={{ height: "300px" }}
        >
          <div className="pnl convex-1 row p-2 no-gutters justify-content-between">
            <div className="col-6 h-100 p-2">
              <div className="h-24 p-2 lead d-flex align-items-center">
                Voice
              </div>
              <div className="h-24 p-2 lead d-flex align-items-center">
                General
              </div>
              <div className="h-24 p-2 lead d-flex align-items-center">
                Memes
              </div>
            </div>
            <div className="col-3 h-100 p-2">
              <div className="row h-24 p-2">
                <div className="pnl concave-2">
                  <div
                    onMouseDown={(e) => {
                      console.log("mouedown");
                      let dif =
                        e.screenX -
                        e.currentTarget.parentNode.getBoundingClientRect();
                      console.log(dif);
                      setStart(dif);
                      setLetMove(true);
                    }}
                    onMouseUp={(e) => {
                      console.log("mouseup");
                      let dif = e.screenX - start;
                      setMove(move + dif);
                      setLetMove(false);
                    }}
                    onMouseMove={(e) => {
                      if (letMove) {
                        let dif = e.screenX - start;
                        console.log(dif);
                        setMove(move + dif);
                        setStart(e.screenX);
                      }
                    }}
                    className="pnl w-65 convex-2 selectDisable"
                    style={{
                      background: "rgb(165, 250, 251)",
                      transform: `translateX(${move}px)`,
                    }}
                  ></div>
                </div>
              </div>
              <div className="row h-24 p-2">
                <div className="pnl concave-2 justify-content-end">
                  <div
                    draggable
                    onDrag={onDrag}
                    className="pnl w-65 convex-2"
                    style={{
                      background: "rgb(165, 250, 251)",
                    }}
                  ></div>
                </div>
              </div>
              <div className="row h-24 p-2">
                <div className="pnl concave-2">
                  <div
                    draggable
                    onDrag={onDrag}
                    className="pnl w-65 convex-2"
                    style={{
                      background: "rgb(165, 250, 251)",
                    }}
                  ></div>
                </div>
              </div>
            </div>
          </div>
        </div>

        <div
          className="col-lg-3 col-md-4 col-sm-4 col-8"
          style={{ height: "300px", maxWidth: "265px" }}
        >
          <div className="row no-gutters h-100 p-2">
            <div className="col-md-12 h-30 p-2">
              <div className="convex-1 pnl align-items-center justify-content-center lead">
                Prefix
              </div>
            </div>
            <div className="col-md-12 h-70 p-2">
              <div className="concave-1 pnl align-items-center justify-content-center display-1">
                <FaEdit
                  style={{
                    position: "absolute",
                    top: "30px",
                    right: "30px",
                    fontSize: "25px",
                    color: "white",
                  }}
                ></FaEdit>
                !
              </div>
            </div>
          </div>
        </div>

        <div className="col-lg-5 col-sm-12 col-12">
          <div
            className="row justify-content-center"
            style={{ height: "300px" }}
          >
            <div className="col-lg-12 col-sm-10 col-12">
              <div className="row h-100 no-gutters p-2">
                <div className="col-4 h-100 no-gutters">
                  <div className="col-12 h-33 p-2">
                    <div className="pnl convex-1 justify-content-center align-items-center">
                      <div style={{ height: "50px", width: "50px" }}>
                        <img src={users[2]} className="img-fluid"></img>
                      </div>
                    </div>
                  </div>
                  <div className="col-12 h-33 p-2">
                    <div className="pnl convex-1 justify-content-center align-items-center">
                      <div style={{ height: "50px", width: "50px" }}>
                        <img src={users[2]} className="img-fluid"></img>
                      </div>
                    </div>
                  </div>
                  <div className="col-12 h-33 p-2">
                    <div className="pnl convex-1 justify-content-center align-items-center">
                      <div style={{ height: "50px", width: "50px" }}>
                        <img src={users[2]} className="img-fluid"></img>
                      </div>
                    </div>
                  </div>
                </div>
                <div className="col-4 h-100 no-gutters">
                  <div className="col-12 h-33 p-2">
                    <div className="pnl convex-1 justify-content-center align-items-center">
                      <div style={{ height: "50px", width: "50px" }}>
                        <img src={users[1]} className="img-fluid"></img>
                      </div>
                    </div>
                  </div>
                  <div className="col-12 h-33 p-2">
                    <div className="pnl convex-1 justify-content-center align-items-center">
                      <div style={{ height: "50px", width: "50px" }}>
                        <img src={users[1]} className="img-fluid"></img>
                      </div>
                    </div>
                  </div>
